`,Mt(t.li,{children:[`
`,Mt(t.p,{children:[Mt(t.strong,{children:"QueryPlanner"})," Selects the most valuable segments by integrating hybrid semantic-lexical scoring with cognitive structural priors (Anchor, Flow, and Flash) to ensure comprehensive information retention."]}),`
`]}),`
`]}),`
`,Mt(t.p,{children:Mt(t.img,{src:"./images/smooth.png",alt:""})}),`
`,Mt(t.p,{children:"The sentence smoother extends the filtered page fragments outward to the nearest sentence boundary, fixing the broken sentences caused by segmentation and ensuring the syntactic coherence of the final compressed text."}),`
`,Mt(t.h3,{children:"Experiment Details"}),`
`,Mt(t.p,{children:"We comprehensively evaluated BEAVER on four diverse long-context benchmarksLongBench, ZeroSCROLLS, RULER, and L-Evalunder strict 2,000 and 3,000 token budgets . All experiments were conducted using gpt-3.5-turbo-instruct as the backend LLM on NVIDIA A100 GPUs, comparing performance against state-of-the-art baselines including the LLMLingua series and embedding-based retrieval methods . Detailed hyperparameter settings are provided in the paper."}),`
`,Mt(t.h3,{children:"Results"}),`
`,Mt(t.p,{children:"Extensive evaluations demonstrate that BEAVER outperforms SOTA baselines across multiple benchmarks, particularly dominating RULER, while achieving a 26.4x speedup on 128k contexts."}),`
`,Mt(t.p,{children:Mt(t.img,{src:"./images/main-table.png",alt:""})}),`
`,Mt(t.p,{children:Mt(t.img,{src:"./images/ruler.png",alt:""})}),`
`,Mt(t.p,{children:Mt(t.img,{src:"./images/l-eval.png",alt:""})}),`
`,Mt(t.p,{children:Mt(t.img,{src:"./images/analysis.png",alt:""})}),`
`,Mt(t.h3,{children:"Conclusion"}),`
`,Mt(t.p,{children:"We introduce BEAVER, a training-free framework that revolutionizes prompt compression via structure-aware page selection . By preserving semantic integrity, it achieves SOTA performance in QA and retrieval while delivering a 26x speedup on 128k contexts. As a scalable, plug-and-play module, BEAVER enables efficient long-document understanding without the need for parameter updates."}),`
`,Mt(t.h3,{children:"Reproducibility Statement"}),`
